const Form = () => {
    return (
        <form>
            <label htmlFor="name">Username</label>
            <input type="text" name="username" />
            <label htmlFor="password">Password</label>
            <input type="password" name="password" />
            <button type="submit">Login</button>
        </form>
    );
}

export default Form
